カネシカ　パターン職人　<br>木の持つ肌理（きめ）を生かし、木鏝をパターン用として新しく蘇らせました。　<br>「業界初！！」木鏝の裏面を曲面にし、パターン作業に最適な形状に仕上ました。　<br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984366.gif" alt=""><br>特徴 <br>●従来の木鏝と違いパターン模様を出すために裏面が曲面形状になった、業界初の「Ｒ面」加工を施しています。 <br>使用方法 <br>●ベース塗りの上からパターン職人のＲ面でカベをヒキズルように使い、模様を出します。Ｒ面を傾けずに引くのがコツです。 <br><br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984368.gif" alt="パターン職人の使い方"><br>平らに塗ったカベ土が乾かないうちにパターン職人を軽く押し付けてから、少し浮かせます。そして左や右に傾けないで、水平のままカベ土を引きずるように動かしてください。引っ込んだカドのところでは、パターン職人を少しだけ傾けると施工しやすくなります。<br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984370.gif" alt=""><br>パターン職人を「右から左へ」または「左から右へ」とまっすぐ引くだけでナチュラルウエーブ模様ができます。　何度でも引き直せますので思いきってご使用下さい。また、引く回数や引く速度によっていろいろな仕上がりを楽しめます。<br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984369.gif" alt=""><br>パターン職人を「Ｓ字」や「８の字」を描くように動かすとランダムウェーブ模様ができます。　このとき不規則（ランダム）にパターン職人を動かすことが重要です。曲線のラフさが独特の味わいをかもし出します<!--ここから楽太郎-->
