カネシカ　ならし職人<br>ヘラ板の耐食性を考慮し、ステンレスを使用しました。。<br>さらにそのヘラ板に穴開け加工を施す事により、従来品に無い耐久性と弾力性、軽さを備え、パターン塗りの最終仕上や波消し仕上げに最適な製品に仕上ました。　<br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984366.gif" alt=""><br><br>特徴 <br>●カベをならす「作業ベラ」とそれを上から押さえる「補助ベラ」の２重構造になっています。<br>●耐久性・耐食性・弾力性を備えたステンレス製。<br>●ヘラ板に穴あけ加工（PAT.P）を施し、パターン塗りの最終仕上げ・波消しに最適です。<br>●柄がヘラと一体になり、握りやすく効率の良い快適な作業が可能です。<br>●ベース塗りの上からパターン職人のＲ面でカベをヒキズルように使い、模様を出します。Ｒ面を傾けずに引くのがコツです。<br><br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984375.gif" alt="カネシカ　ならし職人"><br>●必ず作業ベラ（大きい方）をカベ面に添わせて下さい。補助ベラ（小さい方）は作業ベラを押さえるだけのものです。<br>●ヘラの自然なしなりを利用しながら使います。<br><br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984373.gif" alt="カネシカ　ならし職人　ヘッドカット"><br>パターン職人で作った模様を更に加工！ <br>木鏝で塗り付けたパターン模様の逆立った先端（バリ）を押さえます。<br>軽くならすのが基本ですが、力の加え方によりさまざまなヘッドカットが楽しめます。<br>ワイルドな仕上がりを上品で落ち着いた模様に作り変えることが可能です。 <br><br><img src="https://image.rakuten.co.jp/todakana/cabinet/00993542/img55984374.gif" alt="ならし職人　波消し"><br>引き傷・波消しにも大活躍 <br>重ね塗りのときに発生する波も、ヘラの自然なしなりを利用して軽く撫でるだけで消えます。<!--ここから楽太郎-->
